using System;
using System.Collections.Generic;
using System.Drawing;
using System.Linq;
using System.Numerics;
using System.Text;
using System.Text.RegularExpressions;
using Xunit;
using static AdventOfCode2018.Util;

namespace AdventOfCode2018
{
    public class Day05
    {
        public const string puzzleInput = "";

        [Theory]
        [InlineData("1", 10L, "dabAcCaCBAcCcaDA")]
        [InlineData("1", 1L, "JacCAjx")]
        [InlineData("Actual", 10972L, puzzleInput)]
        public void Test_Solve1(string nr, long expected, string input)
        {
            Assert.Equal(nr, nr); // Suppresses warning
            Assert.Equal(expected, Solve1(input));
        }

        [Theory]
        [InlineData("1", 4L, "dabAcCaCBAcCcaDA")]
        [InlineData("Actual", 5278L, puzzleInput)]
        public void Test_Solve2(string nr, long expected, string input)
        {
            Assert.Equal(nr, nr); // Suppresses warning
            Assert.Equal(expected, Solve2(input));
        }

        public long Solve1(string input)
        {
            var data = input.ToArray();
            return GetPolymerLength(data);
        }

        private static long GetPolymerLength(char[] data)
        {
            int lastIdx = 0;
            bool hasReplaced = false;

            do
            {
                lastIdx = 0;
                hasReplaced = false;

                for (int i = 1; i < data.Length; i++)
                {
                    if (data[lastIdx] == ' ')
                    {
                        lastIdx = i;
                        continue;
                    }

                    if (data[i] == ' ')
                    {
                        continue;
                    }

                    if (data[i] != data[lastIdx]
                        && char.ToUpperInvariant(data[i]) == char.ToUpperInvariant(data[lastIdx]))
                    {
                        data[i] = ' ';
                        data[lastIdx] = ' ';
                        hasReplaced = true;

                        lastIdx = i++;
                        i++;
                    }
                    else if (data[i] != ' ')
                    {
                        lastIdx = i;
                    }
                }
            }
            while (hasReplaced);

            return data.Where(c => c != ' ').Count();
        }

        public long Solve2(string input)
        {
            long bestLength = long.MaxValue;

            for (char c = 'a'; c <= 'z'; c++)
            {
                var data = Regex.Replace(input, $"[{c}{char.ToUpperInvariant(c)}]", "").ToArray();
                var length = GetPolymerLength(data);
                bestLength = Math.Min(length, bestLength);
            }

            return bestLength;
        }
    }
}
